* Immutable slice iterator

This struct is created by the [`iter`] method on [`BitSlice`]s.

# Examples

Basic usage:

```rust
# use bitvec::prelude::*;
let data = 5u8;
let bits = data.bits::<Lsb0>();

for bit in bits[.. 4].iter() {
    println!("{}", bit);
}
```

