* Mutable slice iterator.

This struct is created by the [`iter_mut`] method on [`BitSlice`]s.

# Examples

Basic usage:

```rust
# use bitvec::prelude::*;
let mut data = 0u8;
let bits = data.bits_mut::<Msb0>();
assert!(bits.not_any());
for mut bit in bits.iter_mut() {
    *bit = true;
}
assert!(bits.all());
```

